import React, { Component, useEffect } from 'react';
import BasePageHugeCard from '../BasePages/BasePageHugeCard.js';
import EditThemesListSecretaryForm from '../../components/Tables/EditThemeList/Secretary/EditThemesListSecretaryForm.js';
import GenerateProtocols from '../../components/Forms/GenerateProtocols/GenerateProtocols.js';

const GenerateProtocolsPage = ({ data, composition_of_sec,groups_for_schedule, requestAndWorkProtection}) => {
    useEffect(() => {
        document.title = "Генерация протоколов";
      }, []);
    
    return (
        <BasePageHugeCard isAuthenticated={true} data={data}>
     <GenerateProtocols composition_of_sec={composition_of_sec} groups_for_schedule={groups_for_schedule} requestAndWorkProtection={requestAndWorkProtection} data={data}/>
          </BasePageHugeCard>
      );
    

}
export default GenerateProtocolsPage;
